INSERT INTO `v1_b6a2109c947d88aae5fd65ca6883583001da8786a33a2e43dc0030870ef6c741` VALUES (8, 1, 5118061, "青空の下で謁見", "フリーマーケットを訪れたジータが出会ったのは\n城をこっそり抜け出していたペコリーヌだった。", 0, 2, 2834, 10118, "フリーマーケット会場", "ペコリーヌとの出会い", 91002, 7, 40, 20063115);
INSERT INTO `v1_b6a2109c947d88aae5fd65ca6883583001da8786a33a2e43dc0030870ef6c741` VALUES (8, 1, 5118062, "未来の騎空団\nマスコット？", "ジータたちがフリーマーケットを巡っていると\n露店を出していたマホに声をかけられる。", 0, 2, 2835, 10118, "フリーマーケット会場", "マホとの出会い", 91002, 7, 40, 20063115);
INSERT INTO `v1_b6a2109c947d88aae5fd65ca6883583001da8786a33a2e43dc0030870ef6c741` VALUES (8, 1, 5118063, "お嬢さまからの\n緊急依頼", "ジータが騎空団への依頼を確認していると、\n高笑いをしながらアキノが現れる。", 0, 2, 2837, 10118, "ランドソル市街地", "アキノとの出会い", 91002, 7, 40, 20063115);
INSERT INTO `v1_b6a2109c947d88aae5fd65ca6883583001da8786a33a2e43dc0030870ef6c741` VALUES (8, 1, 5118064, "黄金色の悩みごと", "ジータたちは、フリーマーケット会場で\n少し困った様子のジュンを見かける。", 0, 2, 4108402, 10118, "フリーマーケット会場", "ジュンとの出会い", 91002, 18, 40, 20063115);
INSERT INTO `v1_b6a2109c947d88aae5fd65ca6883583001da8786a33a2e43dc0030870ef6c741` VALUES (8, 1, 5118065, "白熱！　格闘大会！", "フリーマーケットの隅で開かれる格闘大会──\nそこにはカオリもいて……？", 0, 2, 4107402, 10118, "フリーマーケット会場", "カオリとの出会い", 91002, 18, 40, 20063115);
INSERT INTO `v1_b6a2109c947d88aae5fd65ca6883583001da8786a33a2e43dc0030870ef6c741` VALUES (8, 1, 5118066, "祭り太鼓はオーエドの華", "太鼓祭を控えるオーエド町──\nジータは、困った様子のニノンと出会う。", 1, 2, 9000227, 10118, "オーエド町", "ニノンとの出会い", 91002, 16, 40, 20063115);
INSERT INTO `v1_b6a2109c947d88aae5fd65ca6883583001da8786a33a2e43dc0030870ef6c741` VALUES (8, 1, 5118067, "人気者は遅れて\nやってくる", "ビカラはイベントに出演中のスズナを見かける。\nしかし、スズナはどこか困っているようで……？", 0, 3, 2101181, 10118, "フリーマーケット会場", "スズナとの出会い", 91002, 19, 40, 20063115);
INSERT INTO `v1_b6a2109c947d88aae5fd65ca6883583001da8786a33a2e43dc0030870ef6c741` VALUES (8, 1, 5118068, "巫女・ミーツ・魔法少女", "ビカラたちが街を散策していると、通りかかった\nナナカが興奮した様子で近づいてきて……？", 0, 3, 4109402, 10118, "ランドソル市街地", "ナナカとの出会い", 91002, 18, 40, 20063115);
INSERT INTO `v1_b6a2109c947d88aae5fd65ca6883583001da8786a33a2e43dc0030870ef6c741` VALUES (8, 1, 5118069, "ネズ耳は二度なくなる", "ネズ耳をなくしてしまい絶望するビカラ。同じ頃\nキャルとコッコロは落とし物を拾っており……", 0, 3, 4305402, 10118, "フリーマーケット会場", "キャル＆コッコロとの出会い", 91002, 18, 40, 20063115);
INSERT INTO `v1_b6a2109c947d88aae5fd65ca6883583001da8786a33a2e43dc0030870ef6c741` VALUES (8, 1, 5118070, "この出会いにカンパイ！", "街外れでひと休みをしていたビカラたちは、\nすっかりゴキゲンな様子のユカリと出会う。", 0, 3, 4101402, 10118, "ランドソル市街地", "ユカリとの出会い", 91002, 18, 40, 20063115);
INSERT INTO `v1_b6a2109c947d88aae5fd65ca6883583001da8786a33a2e43dc0030870ef6c741` VALUES (8, 1, 5118071, "陰陽アンサンブル", "ビカラは、人混みに怯えるアオイを心配し、\n陽気に声をかけるも……", 0, 3, 4106402, 10118, "ランドソル市街地", "アオイとの出会い", 91002, 18, 40, 20063115);
INSERT INTO `v1_b6a2109c947d88aae5fd65ca6883583001da8786a33a2e43dc0030870ef6c741` VALUES (8, 1, 5118072, "運試し十番勝負！", "ビカラがフリーマーケット会場を歩いていると\n占いをしていたシノブに声をかけられる。", 1, 3, 2836, 10118, "フリーマーケット会場", "シノブとの出会い", 91002, 7, 40, 20063115);
INSERT INTO `v1_b6a2109c947d88aae5fd65ca6883583001da8786a33a2e43dc0030870ef6c741` VALUES (0, 0, 5118600, "彼女たちの新たな日常", 0, 0, 1, 0, 10118, 0, "オープニング", 0, 0, 0, 20063115);
